import React from "react";
import Contact from "./Contact";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <div className="card">
        <Contact name='Beyonce' img='https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg'/>
      </div>
    </div>
  );
}

export default App;
